    data: |
      SELECT ALL - col0 col1 FROM tab0 (FORMAT parquet) WHERE - ( - + CAST ( NULL AS INTEGER ) ) / - col0 + - 74 + ( + col2 ) / col2 * - + col0 * - col1 <= + 48;
  - name: tab0

outputs:
  - name: q7549.out
    data: |
